  "translationLines": [
    {
      "lineNumber": 231152,
      "originalJapaneseLine": "長田君がビックリして割れた。",
      "translatedEnglishLine": "Nagata-kun was so surprised that he cracked."
    },
    {
      "lineNumber": 231153,
      "originalJapaneseLine": "「クッ、ククク……",
      "translatedEnglishLine": "\"Kuh, kukuku...\""
    },
    {
      "lineNumber": 231154,
      "originalJapaneseLine": "　コノ力、ス、素晴ラシ……ク、コ……」",
      "translatedEnglishLine": "This power is su-su-splendid... ku, ko...\""
    },
    {
      "lineNumber": 231155,
      "originalJapaneseLine": "「殺セル、殺セル、殺セル、殺セル……",
      "translatedEnglishLine": "\"Kill, kill, kill, kill...\""
    },
    {
      "lineNumber": 231156,
      "originalJapaneseLine": "　殺ス、殺ス、殺ス、殺ス、殺ス……！」",
      "translatedEnglishLine": "Kill, kill, kill, kill, kill...!\""
    },
    {
      "lineNumber": 231157,
      "originalJapaneseLine": "「シシャーーーーーッ！」",
      "translatedEnglishLine": "\"Dieeeeee!\""
    },
    {
      "lineNumber": 231158,
      "originalJapaneseLine": "二メートル以上はあろうかという巨体で",
      "translatedEnglishLine": "With a gigantic body that must be over two meters tall,"
    },
    {
      "lineNumber": 231159,
      "originalJapaneseLine": "俊敏に動きアームズに猛攻撃を加える。",
      "translatedEnglishLine": "it moves swiftly and launches a fierce attack on Arms."
    },
    {
      "lineNumber": 231160,
      "originalJapaneseLine": "「ぐっ、くっ！」",
      "translatedEnglishLine": "\"Guh, kuh!\""
    },
    {
      "lineNumber": 231161,
      "originalJapaneseLine": "ジャハルッカスの攻撃の一つ一つを、",
      "translatedEnglishLine": "Each of Jaharukas' attacks,"
    },
    {
      "lineNumber": 231162,
      "originalJapaneseLine": "得物の日本刀で捌き続けているが、",
      "translatedEnglishLine": "Arms continues to parry with his trusty Japanese sword,"
    },
    {
      "lineNumber": 231163,
      "originalJapaneseLine": "アームズの表情にはハッキリと焦りが浮かんでいた。",
      "translatedEnglishLine": "but frustration was clearly visible on Arms' face."
    },
    {
      "lineNumber": 231164,
      "originalJapaneseLine": "「決まったな」",
      "translatedEnglishLine": "\"It's decided.\""
    },
    {
      "lineNumber": 231165,
      "originalJapaneseLine": "「ああ」",
      "translatedEnglishLine": "\"Yeah.\""
    },
    {
      "lineNumber": 231166,
      "originalJapaneseLine": "「クキャキャーーーーッ！」",
      "translatedEnglishLine": "\"Kyakyakyaaaaaa!\""
    },
    {
      "lineNumber": 231167,
      "originalJapaneseLine": "「なっ！？」",
      "translatedEnglishLine": "\"Wha!?\""
    },
    {
      "lineNumber": 231168,
      "originalJapaneseLine": "アームズの武器が弾かれ、胴ががら空きとなる。",
      "translatedEnglishLine": "Arms' weapon was deflected, leaving his torso wide open."
    },
    {
      "lineNumber": 231169,
      "originalJapaneseLine": "（くっ！　ここまでか……！？）",
      "translatedEnglishLine": "(Damn! Is this the end...!?)"
    },
    {
      "lineNumber": 231170,
      "originalJapaneseLine": "アームズが死を覚悟した、その刹那――",
      "translatedEnglishLine": "At the moment Arms resigned himself to death—"
    },
    {
      "lineNumber": 231171,
      "originalJapaneseLine": "「グギッ！？」",
      "translatedEnglishLine": "\"Gugh!?\""
    },
    {
      "lineNumber": 231172,
      "originalJapaneseLine": "目の前にいるジャハルッカスが苛立たしげに",
      "translatedEnglishLine": "The Jaharukas in front of him glared at you with irritation."
    },
    {
      "lineNumber": 231173,
      "originalJapaneseLine": "あなたの顔を睨みつける。",
      "translatedEnglishLine": "It glared fiercely at your face."
    },
    {
      "lineNumber": 231174,
      "originalJapaneseLine": "あなたは無意識のうちに動き、",
      "translatedEnglishLine": "You moved unconsciously,"
    },
    {
      "lineNumber": 231175,
      "originalJapaneseLine": "ジャハルッカスの攻撃を弾いていた。",
      "translatedEnglishLine": "deflecting Jaharukas' attack."
    },
    {
      "lineNumber": 231176,
      "originalJapaneseLine": "「なっ、君は……！」",
      "translatedEnglishLine": "\"Wh-who are you...!\""
    },
    {
      "lineNumber": 231177,
      "originalJapaneseLine": "「…………。」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 231178,
      "originalJapaneseLine": "「な、お、おい！　よせ！」",
      "translatedEnglishLine": "\"H-hey, hey! Stop that!\""
    },
    {
      "lineNumber": 231179,
      "originalJapaneseLine": "あなたはアームズの言葉を無視して、",
      "translatedEnglishLine": "Ignoring Arms' words,"
    },
    {
      "lineNumber": 231180,
      "originalJapaneseLine": "ジャハルッカスに向き直った。",
      "translatedEnglishLine": "you turned to face Jaharukas."
    },
    {
      "lineNumber": 231181,
      "originalJapaneseLine": "「は？　大丈夫って……」",
      "translatedEnglishLine": "\"Huh? I'm okay, you say...?\""
    },
    {
      "lineNumber": 231182,
      "originalJapaneseLine": "「あ、おい！」",
      "translatedEnglishLine": "\"H-hey!\""
    },
    {
      "lineNumber": 231183,
      "originalJapaneseLine": "あなたはアームズをその場において、",
      "translatedEnglishLine": "You left Arms standing there,"
    },
    {
      "lineNumber": 231184,
      "originalJapaneseLine": "ジャハルッカスに向き直った。",
      "translatedEnglishLine": "and turned to face Jaharukas."
    },
    {
      "lineNumber": 231185,
      "originalJapaneseLine": "あなたは無言のまま、",
      "translatedEnglishLine": "Without saying a word,"
    },
    {
      "lineNumber": 231186,
      "originalJapaneseLine": "ジャハルッカスに向き直る。",
      "translatedEnglishLine": "you faced Jaharukas."
    },
    {
      "lineNumber": 231187,
      "originalJapaneseLine": "「お、おい！　＜エール＞！」",
      "translatedEnglishLine": "\"H-hey! <Yell>!\""
    },
    {
      "lineNumber": 231188,
      "originalJapaneseLine": "「シャアアアアアアアアアア！！！！」",
      "translatedEnglishLine": "\"Shaaahhhhhhhhh!!!\""
    },
    {
      "lineNumber": 231189,
      "originalJapaneseLine": "「ガッ、ゴッ……グ、ア……！」",
      "translatedEnglishLine": "\"Gah, guh... gu, ah...!\""
    },
    {
      "lineNumber": 231190,
      "originalJapaneseLine": "ジャハルッカスがその場に崩れ落ちる。",
      "translatedEnglishLine": "Jaharukas collapsed on the spot."
    },
    {
      "lineNumber": 231191,
      "originalJapaneseLine": "「がはははははははは！",
      "translatedEnglishLine": "\"Gahahahahahaha!"
    },
    {
      "lineNumber": 231192,
      "originalJapaneseLine": "　楽勝ー！」",
      "translatedEnglishLine": "That was a piece of cake!\""
    },
    {
      "lineNumber": 231193,
      "originalJapaneseLine": "「ふう……",
      "translatedEnglishLine": "\"Phew...\""
    },
    {
      "lineNumber": 231194,
      "originalJapaneseLine": "　みんな、お疲れ様」",
      "translatedEnglishLine": "Good job, everyone.\""
    },
    {
      "lineNumber": 231195,
      "originalJapaneseLine": "「あーっ、楽しかったー！」",
      "translatedEnglishLine": "\"Ahh, that was fun!\""
    },
    {
      "lineNumber": 231196,
      "originalJapaneseLine": "「あーっ、怖かったよー！」",
      "translatedEnglishLine": "\"Ahh, that was scary!\""
    },
    {
      "lineNumber": 231197,
      "originalJapaneseLine": "ジャハルッカスとの戦闘を終え、",
      "translatedEnglishLine": "Having finished the battle with Jaharukas,"
    },
    {
      "lineNumber": 231198,
      "originalJapaneseLine": "それぞれが好きに感想を漏らす。",
      "translatedEnglishLine": "each person expressed their thoughts freely."
    },
    {
      "lineNumber": 231199,
      "originalJapaneseLine": "その様を、先程まで戦闘していたアームズが",
      "translatedEnglishLine": "Arms, who had been fighting just moments ago,"
    },
    {
      "lineNumber": 231200,
      "originalJapaneseLine": "少し呆然として眺めていた。",
      "translatedEnglishLine": "watched the scene somewhat dazed."
    },
    {
      "lineNumber": 231201,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 231202,
      "originalJapaneseLine": "「強い……」",
      "translatedEnglishLine": "\"Strong...\""
    },
    {
      "lineNumber": 231203,
      "originalJapaneseLine": "（ジャハルッカスは決して弱くない）",
      "translatedEnglishLine": "(Jaharukas is by no means weak.)"
    },
    {
      "lineNumber": 231204,
      "originalJapaneseLine": "（いや、むしろ魔人クラスの強さがある相手……）",
      "translatedEnglishLine": "(No, rather, an opponent with strength on the level of a demon lord...)"
    },
    {
      "lineNumber": 231205,
      "originalJapaneseLine": "（今日の私は病気の影響もなく、",
      "translatedEnglishLine": "(Today, I was free from the effects of illness,"
    },
    {
      "lineNumber": 231206,
      "originalJapaneseLine": "　装備も世界最強クラスを揃えた、",
      "translatedEnglishLine": "and equipped with some of the world's strongest gear,"
    },
    {
      "lineNumber": 231207,
      "originalJapaneseLine": "　万全の状態だったのだがな……）",
      "translatedEnglishLine": "I was in perfect condition... but still...)"
    },
    {
      "lineNumber": 231208,
      "originalJapaneseLine": "（ふっ……）",
      "translatedEnglishLine": "(Hmph...)"
    },
    {
      "lineNumber": 231209,
      "originalJapaneseLine": "（私に出来なかったことを",
      "translatedEnglishLine": "(What I couldn't do"
    },
    {
      "lineNumber": 231210,
      "originalJapaneseLine": "　この人数差とは言えこの子達は……）",
      "translatedEnglishLine": "these kids did despite the difference in numbers...)"
    },
    {
      "lineNumber": 231211,
      "originalJapaneseLine": "（いや……）",
      "translatedEnglishLine": "(No...)"
    }
  ]
}

